import React from 'react'
import { Link, Outlet, useLocation } from 'react-router-dom';
import './MsTeams.css';
import menu from '../Sections/menu.png';
import chat from '../Sections/chat.png';
import meet from '../Sections/video.png';
import teams from '../Sections/team.png';
import mscalendar from '../Sections/teamscalendar.png';
import notification from '../Sections/notification.png';
import settings from '../Sections/setting.png';
import msteams from '../Sections/msteams.png';

export const MsTeams = () => {
  const location = useLocation();

  const navItems = [
    { to: "chat", icon: chat, label: "Chat" },
    { to: "meet", icon: meet, label: "Meet" },
    { to: "communities", icon: teams, label: "Teams" },
    { to: "mscalendar", icon: mscalendar, label: "Calendar" },
    { to: "notification", icon: notification, label: "Notifications" },
  ];

  return (
    <div className="ms-container">
      <div className='msteams-sidebar'>
        
        {/* Top Section */}
        <div className="sidebar-top">
          <div className="ms-sidebar-logo">
            <img src={msteams} alt="Teams Logo" className="logo" />
          </div>
          {navItems.map((item) => (
            <Link 
              key={item.to} 
              to={item.to} 
              className={`ms-sidebar-item ${location.pathname.includes(item.to) ? 'active' : ''}`}
            >
              <img src={item.icon} alt={item.label} />
              <span>{item.label}</span>
            </Link>
          ))}
        </div>

        {/* Bottom Section */}
        <div className="sidebar-bottom">
          <Link to="settings" className='ms-sidebar-item'>
            <img src={settings} alt="Settings" />
            <span>Settings</span>
          </Link>
        </div>
      </div>

      {/* Main Content */}
      <div className="ms-main-content">
        <div className="ms-topbar">
          <input type="text" className="ms-search" placeholder="Search" />
          <div className="ms-actions">
            <img src={notification} alt="Notifications" />
            <div className="profile-circle"></div>
          </div>
        </div>
        <Outlet />
      </div>
    </div>
  )
}
